import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css';

import { Switch, Route } from 'react-router-dom'
import BeerList from './../components/pages/Beer-list/Beer-list'

function App() {
  return (
    <Switch>
      <Route path="/beers" exact render={() => <BeerList />} />
    </Switch>
  );
}

export default App;
